    <div class="accordion-col dark">

        <div class="exterior" :class="{ 'active': tab === 'exterior' }">
            <h2>Доп. оборудование и защиты</h2>
            <div class="accordion">

                <div id="zashitaKartera" class="accordion-item" :class="{ 'active': item === 'zashitaKartera' }"
                    @click="item = 'zashitaKartera'">
                    <div class="title">
                        <h3>Защиты картера и КПП</h3>
                        <div class="plus-icon"
                            @click.stop="item === 'zashitaKartera' ? item = null : item = 'zashitaKartera'">
                            <svg width="48" height="48" fill="none" viewBox="0 0 48 48">
                                <rect width="48" height="48" fill="#E71923" rx="24" transform="matrix(-1 0 0 1 48 0)" />
                                <rect class="white-circle" width="48" height="48" fill="#fff" rx="24"
                                    transform="matrix(-1 0 0 1 48 0)" />
                                <path stroke="#fff" d="M24 24l-.001 10M24 24l10-.001M24 24l-10 .001M24 24l.001-10" />
                            </svg>
                        </div>
                    </div>
                    <hr>
                    <div class="body">
                        <p>
                            Защита картера – устройство, которое защищает узлы и агрегаты двигателя от механических
                            повреждений. Выполнен из алюминия или стали толщиной от 2 до 5 мм.</p>
                        <p>Производитель ALFeco.</p>
                    </div>
                </div>

                <div id="reshetkiZashitaRadiatora" class="accordion-item" :class="{ 'active': item === 'reshetkiZashitaRadiatora' }"
                    @click="item = 'reshetkiZashitaRadiatora'">

                    <div class="title">
                        <h3>Решетки и защита радиатора</h3>
                        <div class="plus-icon"
                            @click.stop="item === 'reshetkiZashitaRadiatora' ? item = null : item = 'reshetkiZashitaRadiatora'">
                            <svg width="48" height="48" fill="none" viewBox="0 0 48 48">
                                <rect width="48" height="48" fill="#E71923" rx="24" transform="matrix(-1 0 0 1 48 0)" />
                                <rect class="white-circle" width="48" height="48" fill="#fff" rx="24"
                                    transform="matrix(-1 0 0 1 48 0)" />
                                <path stroke="#fff" d="M24 24l-.001 10M24 24l10-.001M24 24l-10 .001M24 24l.001-10" />
                            </svg>
                        </div>
                    </div>
                    <hr>
                    <div class="body">
                        <p>
                            Защитная сетка, которая выполнена с учетом геометрии штатной решётки автомобиля.
                            Предотвращает
                            попадание мелких камней и мусора, которые повреждают систему и нарушают работу радиатора.
                        </p>
                        <p>Производитель Allest.</p>
                        <br>
                        <p>
                            Решетка радиатора изменит внешний вид вашего автомобиля, а также защитит радиатор от
                            небольших
                            камней и других нежелательных элементов во время движения.
                            Решетка изготовлена нержавеющей полированной стали AISI 304 толщиной стенки 1мм. В
                            конструкции
                            используются трубы или листовой перфорированный металл (в зависимости от модели решетки).
                        </p>
                    </div>
                </div>

                <div id="ammort" class="accordion-item" :class="{ 'active': item === 'ammort' }" @click="item = 'ammort'">

                    <div class="title">
                        <h3>Упоры (амортизаторы) капота</h3>
                        <div class="plus-icon" @click.stop="item === 'ammort' ? item = null : item = 'ammort'">
                            <svg width="48" height="48" fill="none" viewBox="0 0 48 48">
                                <rect width="48" height="48" fill="#E71923" rx="24" transform="matrix(-1 0 0 1 48 0)" />
                                <rect class="white-circle" width="48" height="48" fill="#fff" rx="24"
                                    transform="matrix(-1 0 0 1 48 0)" />
                                <path stroke="#fff" d="M24 24l-.001 10M24 24l10-.001M24 24l-10 .001M24 24l.001-10" />
                            </svg>
                        </div>
                    </div>
                    <hr>
                    <div class="body">
                        <p>
                            Основная функция аксессуара — безопасное удерживание капота под различными углами наклона в
                            открытом состоянии. С помощью амортизатора осмотр и обслуживание транспортного средства
                            становится
                            удобнее.
                            <br>
                            В преимущества упора также входит бесшумное закрытие капота, а также освобождение от
                            эксплуатации
                            заводского держателя. Между собой изделия отличаются, поэтому нужно уделить особое внимание
                            при их
                            выборе и приобретении.
                        </p>
                    </div>
                </div>

                <div id="zashitaBampera" class="accordion-item" :class="{ 'active': item === 'zashitaBampera' }"
                    @click="item = 'zashitaBampera'">

                    <div class="title">
                        <h3>Защита бампера (обвесы)</h3>
                        <div class="plus-icon"
                            @click.stop="item === 'zashitaBampera' ? item = null : item = 'zashitaBampera'">
                            <svg width="48" height="48" fill="none" viewBox="0 0 48 48">
                                <rect width="48" height="48" fill="#E71923" rx="24" transform="matrix(-1 0 0 1 48 0)" />
                                <rect class="white-circle" width="48" height="48" fill="#fff" rx="24"
                                    transform="matrix(-1 0 0 1 48 0)" />
                                <path stroke="#fff" d="M24 24l-.001 10M24 24l10-.001M24 24l-10 .001M24 24l.001-10" />
                            </svg>
                        </div>
                    </div>
                    <hr>
                    <div class="body">
